func (q *Queries) GetCompanyUsersByUsersID(ctx context.Context, usersID int64) (CompanyUser, error) {
	row := q.db.QueryRow(ctx, getCompanyUsersByUsersID, usersID)
	var i CompanyUser
	err := row.Scan(
		&i.ID,
		&i.UsersID,
		&i.CompanyID,
		&i.CompanyDepartment,
		&i.CompanyRoles,
		&i.UserRank,
		&i.LeaderID,
		&i.IsVerified,
		&i.CreatedBy,
		&i.CreatedAt,
		&i.UpdatedAt,
		&i.ActiveListings,
	)
	return i, err
}
